import React from 'react';
import styled from 'styled-components';

const StyledHeader = styled.div`
  margin: 20px 5px;
  font-weight: bold;
  font-size: 30px;
`;

const Header = () => {
  return <StyledHeader>Josh Nguyen Photo Grid</StyledHeader>
};

export default Header;
